import React from 'react'
import CommonShadowBox from '../UICoponents/CommonShadowBox'

export default function ProfileSettings() {
    return (
        <CommonShadowBox className="profile-settings-wrapper">
            <div className='title'>
                <h4>Platform Settings</h4>
            </div>
        </CommonShadowBox>
    )
}
